import Grid from '@mui/material/Grid'


const Product = () => {
// create array of objects these are our products
  const products = [
    {Name:"Blood Moon", Description: " berries, spice, and life", Id: 9165, Price:"$3.25", PriceLarge: '$8.99'},
    {Name:"Holiday", Description: "Yellow energy from the sun ", Id:4728, Price:"$3.25", PriceLarge: '$8.99'},
    {Name:"Abundant Earth", Description: " Green is clean", Id:32416 , Price:"$3.25", PriceLarge: '$8.99'},     {name:"Seasonal", Description: " Cylce of variables", Id: 71177, Price:"$3.25", PriceLarge: '$8.99'},
    {Name: "florals for spring? Groundbreaking", Description: "The notorious floral escape", Id: 59212, Price:"$3.50", PriceLarge: '$9.99'}
  ];
  return (
    <>
     <div>
      <Grid container spacing={{ xs: 2, md: 3 }} columns={{ xs: 4, sm: 8, md: 12 }}>
        {products.map((produck) => (
          <Grid item xs={2} sm={4} md={4} >
            <div>
              {produck}
            </div>
            
          </Grid>
        ))}
      </Grid>
      </div>

      
    </>
  )
}

export default Product
